import React from 'react'
import '/Users/pernilla/Documents/portfolio/portfolio/src/components/ProjectPic/styles.css';

function ProjectPic(props) {

    return (
        <>
            <div className="picture_card">
                <img src={props.src} className="project_img"></img>
            </div>

            <div class="grid2x2">
                <div class="box box1"><div>one</div></div>
                <div class="box box2"><div>two</div></div>
                <div class="box box3"><div>three</div></div>
                <div class="box box4"><div>four</div></div>
            </div>

        </>
    );
}

export default ProjectPic;
